import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as r,d as i}from"./app.a3d402e1.js";var t="/assets/project-progress-management.png",s="/assets/project-progress-management-0.png",h="/assets/project-progress-management-1.png",p="/assets/project-progress-management-2.png",d="/assets/project-progress-management-3.png",n="/assets/project-progress-management-4.png",l="/assets/project-progress-management-5.png",o="/assets/project-progress-management-6.png";const c={},m=i('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u6838\u5FC3\u6982\u5FF5" tabindex="-1"><a class="header-anchor" href="#\u6838\u5FC3\u6982\u5FF5" aria-hidden="true">#</a> \u6838\u5FC3\u6982\u5FF5</h2><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406\u662F\u6307\u8BA9\u4E00\u5207\u6309\u7167\u65E2\u5B9A\u7684\u8FDB\u5EA6\u8FDB\u884C, \u5BF9\u9879\u76EE\u8FDB\u884C\u5408\u7406\u7684\u65F6\u95F4\u7BA1\u7406, \u624D\u662F\u4FDD\u8BC1\u9879\u76EE\u987A\u5229\u4EA4\u4ED8\u7684\u5173\u952E, \u90A3\u4E48\u5982\u4F55\u624D\u80FD\u505A\u597D\u9879\u76EE\u65F6\u95F4\u7BA1\u7406\u5462\uFF1F\u53EF\u4EE5\u4ECE\u516D\u4E2A\u65B9\u9762\u5165\u624B\uFF1A\u5B9A\u4E49\u9879\u76EE\u8303\u56F4, \u6CE8\u91CD\u5206\u89E3\u5DE5\u4F5C\uFF1B\u5BF9\u9879\u76EE\u5DE5\u4F5C\u8FDB\u884C\u4F18\u5148\u6392\u5E8F\uFF1B\u9879\u76EE\u5DE5\u671F\u4F30\u7B97\uFF1B\u5236\u5B9A\u9879\u76EE\u8FDB\u5EA6\u8868\uFF1B\u8FDB\u884C\u8FDB\u5EA6\u63A7\u5236\uFF1B\u5DE5\u5177\u4F7F\u7528\u7B49\u3002</p></div><p>\u5177\u6709\u672A\u5B8C\u9879\u7684\u8FED\u4EE3\u578B\u8FDB\u5EA6\u8BA1\u5212\uFF1A\u5C06\u9700\u6C42\u8BB0\u5F55\u5728\u7528\u6237\u6545\u4E8B\u4E2D, \u7136\u540E\u5728\u5EFA\u9020\u4E4B\u524D\u6309\u4F18\u5148\u7EA7\u6392\u5E8F\u5E76\u4F18\u5316\u7528\u6237\u6545\u4E8B, \u6700\u540E\u5728\u89C4\u5B9A\u7684\u65F6\u95F4\u76D2\u5185\u5F00\u53D1\u4EA7\u54C1\u529F\u80FD\u3002</p><p>\u6309\u9700\u8FDB\u5EA6\u8BA1\u5212\uFF1A\u4E0D\u4F9D\u8D56\u4E8E\u4EE5\u524D\u4E3A\u4EA7\u54C1\u5F00\u53D1\u6216\u4EA7\u54C1\u589E\u91CF\u5236\u5B9A\u7684\u8FDB\u5EA6\u8BA1\u5212, \u800C\u662F\u5728\u8D44\u6E90\u53EF\u7528\u65F6\u7ACB\u5373\u4ECE\u672A\u5B8C\u9879\u548C\u5DE5\u4F5C\u5E8F\u5217\u4E2D\u63D0\u53D6\u51FA\u6765\u5F00\u5C55\u3002</p><h2 id="\u601D\u7EF4\u5BFC\u56FE" tabindex="-1"><a class="header-anchor" href="#\u601D\u7EF4\u5BFC\u56FE" aria-hidden="true">#</a> \u601D\u7EF4\u5BFC\u56FE</h2><p><img src="'+t+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406"></p><h2 id="\u5982\u4F55\u505A\u597D\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u5982\u4F55\u505A\u597D\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406" aria-hidden="true">#</a> \u5982\u4F55\u505A\u597D\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406</h2><p><img src="'+s+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406"></p><h2 id="\u89C4\u5212\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u89C4\u5212\u8FC7\u7A0B\u7EC4</h2><h3 id="\u89C4\u5212\u8FDB\u5EA6\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8FDB\u5EA6\u7BA1\u7406" aria-hidden="true">#</a> \u89C4\u5212\u8FDB\u5EA6\u7BA1\u7406</h3><p>\u8FDB\u5EA6\u7BA1\u7406\u8BA1\u5212\u65E0\u8FDB\u5EA6, \u53EA\u662F\u4E00\u4E2A\u63CF\u8FF0\u5982\u4F55\u7BA1\u7406\u8FDB\u5EA6\u7684\u6307\u5357\u3002</p><p>\u4E3A\u5982\u4F55\u5728\u6574\u4E2A\u9879\u76EE\u671F\u95F4\u7BA1\u7406\u9879\u76EE\u63D0\u4F9B\u6307\u5357\u548C\u65B9\u5411\u3002</p><h4 id="itto" tabindex="-1"><a class="header-anchor" href="#itto" aria-hidden="true">#</a> ITTO</h4><p><img src="'+h+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u89C4\u5212\u8FDB\u5EA6\u7BA1\u7406"></p><h3 id="\u5B9A\u4E49\u6D3B\u52A8" tabindex="-1"><a class="header-anchor" href="#\u5B9A\u4E49\u6D3B\u52A8" aria-hidden="true">#</a> \u5B9A\u4E49\u6D3B\u52A8</h3><p>\u8BC6\u522B\u548C\u8BB0\u5F55\u4E3A\u5B8C\u6210\u9879\u76EE\u53EF\u4EA4\u4ED8\u6210\u679C\u800C\u9700\u91C7\u53D6\u7684\u5177\u4F53\u884C\u52A8\u7684\u8FC7\u7A0B\u3002</p><p>\u5C06\u5DE5\u4F5C\u5305\u5206\u89E3\u4E3A\u8FDB\u5EA6\u6D3B\u52A8, \u4F5C\u4E3A\u5BF9\u9879\u76EE\u5DE5\u4F5C\u8FDB\u884C\u8FDB\u5EA6\u4F30\u7B97\u3001\u89C4\u5212\u3001\u6267\u884C\u3001\u76D1\u7763\u548C\u63A7\u5236\u7684\u57FA\u7840\u3002</p><p>\u8303\u56F4\u57FA\u51C6\uFF1A\u5728\u5B9A\u4E49\u6D3B\u52A8\u65F6, \u9700\u660E\u786E\u8003\u8651\u8303\u56F4\u57FA\u51C6\u4E2D\u7684\u9879\u76EE WBS\u3001\u53EF\u4EA4\u4ED8\u6210\u679C\u3001\u5236\u7EA6\u56E0\u7D20\u548C\u5047\u8BBE\u6761\u4EF6\u3002</p><h4 id="itto-1" tabindex="-1"><a class="header-anchor" href="#itto-1" aria-hidden="true">#</a> ITTO</h4><p><img src="'+p+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u5B9A\u4E49\u6D3B\u52A8"></p><h3 id="\u6392\u5217\u6D3B\u52A8\u987A\u5E8F" tabindex="-1"><a class="header-anchor" href="#\u6392\u5217\u6D3B\u52A8\u987A\u5E8F" aria-hidden="true">#</a> \u6392\u5217\u6D3B\u52A8\u987A\u5E8F</h3><p>\u672C\u8FC7\u7A0B\u7684\u4E3B\u8981\u4F5C\u7528\u662F\u5B9A\u4E49\u5DE5\u4F5C\u4E4B\u95F4\u7684\u903B\u8F91\u987A\u5E8F, \u4EE5\u4FBF\u5728\u65E2\u5B9A\u7684\u6240\u6709\u9879\u76EE\u5236\u7EA6\u56E0\u7D20\u4E0B\u83B7\u5F97\u6700\u9AD8\u7684\u6548\u7387\u3002</p><h4 id="itto-2" tabindex="-1"><a class="header-anchor" href="#itto-2" aria-hidden="true">#</a> ITTO</h4><p><img src="'+d+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u6392\u5217\u6D3B\u52A8\u987A\u5E8F"></p><h3 id="\u4F30\u7B97\u6D3B\u52A8\u6301\u7EED\u65F6\u95F4" tabindex="-1"><a class="header-anchor" href="#\u4F30\u7B97\u6D3B\u52A8\u6301\u7EED\u65F6\u95F4" aria-hidden="true">#</a> \u4F30\u7B97\u6D3B\u52A8\u6301\u7EED\u65F6\u95F4</h3><p>\u4F30\u7B97\u6D3B\u52A8\u6301\u7EED\u65F6\u95F4\u662F\u6839\u636E\u8D44\u6E90\u4F30\u7B97\u7684\u7ED3\u679C, \u4F30\u7B97\u5B8C\u6210\u5355\u9879\u6D3B\u52A8\u6240\u9700\u5DE5\u4F5C\u65F6\u6BB5\u6570\u7684\u8FC7\u7A0B\u3002</p><p>\u50A8\u5907\u5206\u6790\uFF1A</p><ul><li>\u5E94\u6025\u50A8\u5907\uFF08\u5DF2\u77E5 --- \u672A\u77E5\uFF09\u3010\u4E8B\u5148\u80FD\u8BC6\u522B\u51FA\u6765\u7684\uFF08\u60F3\u5F97\u5230\u7684\uFF09 --- \u4E0D\u9700\u6C42\uFF08\u6216\u4E0D\u80FD\uFF09\u4E3B\u52A8\u7BA1\u7406\u3011 <ul><li>\u662F\u4FDD\u62A4\u5728\u8FDB\u5EA6\u57FA\u51C6\u4E2D\u7684\u4E00\u6BB5\u6301\u7EED\u65F6\u95F4, \u7528\u6765\u5E94\u5BF9\u5DF2\u7ECF\u63A5\u53D7\u7684\u5DF2\u77E5\u98CE\u9669\u3002</li><li>\u5E94\u6025\u50A8\u5907\u5728\u6700\u7EC8\u7684\u57FA\u51C6\u4E2D</li><li>\u9879\u76EE\u7ECF\u7406\u53EF\u4EE5\u76F4\u63A5\u4F7F\u7528, \u4E0D\u9700\u8981\u8D70\u53D8\u66F4\u6D41\u7A0B</li></ul></li><li>\u7BA1\u7406\u50A8\u5907\uFF08\u672A\u77E5 --- \u672A\u77E5\uFF09\u3010\u4E8B\u5148\u4E0D\u80FD\u8BC6\u522B\u51FA\u6765\uFF08\u60F3\u4E0D\u5230\u7684\uFF09 --- \u4E0D\u9700\u6C42\uFF08\u6216\u4E0D\u80FD\uFF09\u4E3B\u52A8\u7BA1\u7406\u3011 <ul><li>\u662F\u4E3A\u7BA1\u7406\u63A7\u5236\u7684\u76EE\u7684\u800C\u7279\u522B\u7559\u51FA\u7684\u9879\u76EE\u9884\u7B97, \u7528\u6765\u5E94\u5BF9\u9879\u76EE\u8303\u56F4\u4E2D\u4E0D\u53EF\u9884\u89C1\u7684\u5DE5\u4F5C\u3002</li><li>\u7BA1\u7406\u50A8\u5907\u4E0D\u5728\u6700\u7EC8\u7684\u57FA\u51C6\u4E2D</li><li>\u9879\u76EE\u7ECF\u7406\u9700\u8981\u8D70\u53D8\u66F4\u6D41\u7A0B\u7533\u8BF7</li></ul></li></ul><h4 id="itto-3" tabindex="-1"><a class="header-anchor" href="#itto-3" aria-hidden="true">#</a> ITTO</h4><p><img src="'+n+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u4F30\u7B97\u6D3B\u52A8\u6301\u7EED\u65F6\u95F4"></p><h3 id="\u5236\u5B9A\u8FDB\u5EA6\u8BA1\u5212" tabindex="-1"><a class="header-anchor" href="#\u5236\u5B9A\u8FDB\u5EA6\u8BA1\u5212" aria-hidden="true">#</a> \u5236\u5B9A\u8FDB\u5EA6\u8BA1\u5212</h3><p>\u5236\u5B9A\u8FDB\u5EA6\u8BA1\u5212\u662F\u5206\u6790\u6D3B\u52A8\u987A\u5E8F\u3001\u6301\u7EED\u65F6\u95F4\u3001\u8D44\u6E90\u9700\u6C42\u548C\u8FDB\u5EA6\u5236\u7EA6\u56E0\u7D20, \u521B\u5EFA\u8FDB\u5EA6\u6A21\u578B, \u4ECE\u800C\u843D\u5B9E\u9879\u76EE\u6267\u884C\u548C\u76D1\u63A7\u7684\u8FC7\u7A0B\u3002</p><h4 id="itto-4" tabindex="-1"><a class="header-anchor" href="#itto-4" aria-hidden="true">#</a> ITTO</h4><p>\u5173\u952E\u8DEF\u5F84\u6CD5</p><ul><li>\u5173\u952E\u8DEF\u5F84\u662F\u9879\u76EE\u4E2D\u65F6\u95F4\u6700\u957F\u7684\u6D3B\u52A8\u987A\u5E8F, \u51B3\u5B9A\u7740\u53EF\u80FD\u7684\u9879\u76EE\u6700\u77ED\u5DE5\u671F</li><li>\u603B\u6D6E\u52A8\u65F6\u95F4\uFF1A\u6D3B\u52A8\u5EF6\u671F\u4F46\u4E0D\u81F3\u4E8E\u5EF6\u8FDF\u9879\u76EE\u5B8C\u5DE5\u65E5\u671F\u3002\u4F53\u73B0\u8FDB\u5EA6\u7075\u6D3B\u6027</li><li>\u81EA\u7531\u6D6E\u52A8\u65F6\u95F4\uFF1A\u6D3B\u52A8\u5EF6\u671F\u4F46\u4E0D\u5EF6\u8BEF\u4EFB\u4F55\u7D27\u540E\u6D3B\u52A8\u6700\u65E9\u5F00\u59CB\u65F6\u95F4</li><li>\u5173\u952E\u8DEF\u5F84\u6CD5\u6392\u51FA\u6765\u7684\u8FDB\u5EA6\u8BA1\u5212\u672A\u5FC5\u53EF\u884C, \u5173\u952E\u8DEF\u5F84\u6CD5\u4E0D\u8003\u8651\u8D44\u6E90\u7EA6\u675F, \u9700\u8981\u914D\u5408\u8D44\u6E90\u5E73\u8861\u5904\u7406</li><li>\u5173\u952E\u8DEF\u5F84\u4E0A\u7684\u5173\u952E\u6D3B\u52A8\u7684\u603B\u6D6E\u52A8\u65F6\u95F4\u53EF\u80FD\u662F\u6B63\u503C\u4E5F\u53EF\u80FD\u662F\u8D1F\u503C</li><li>\u5173\u952E\u8DEF\u5F84\u4E0D\u8003\u8651\u8D44\u6E90\u7EA6\u675F, \u53EA\u662F\u8003\u8651\u7EA6\u675F</li></ul><p>\u5728\u5173\u952E\u8DEF\u5F84\u4E0A\u53EF\u4EE5\u8FDB\u884C\u538B\u7F29\u5DE5\u671F\u4EE5\u4F7F\u603B\u5DE5\u671F\u7F29\u77ED, \u5728\u975E\u5173\u952E\u8DEF\u5F84\u4E0A\u5229\u7528\u8D44\u6E90\u5E73\u6ED1\u8FDB\u884C\u62BD\u53D6\u8D44\u6E90, \u51CF\u5C11\u4EBA\u5458\u77ED\u7F3A\u5E26\u6765\u7684\u5F71\u54CD\u3002</p><p>\u8D44\u6E90\u4F18\u5316\uFF08\u89E3\u51B3\u8D44\u6E90\u8D1F\u8377\u8FC7\u5927\uFF09\uFF1A\u6839\u636E\u8D44\u6E90\u4F9B\u9700\u60C5\u51B5, \u6765\u8C03\u6574\u8FDB\u5EA6\u6A21\u578B\u7684\u6280\u672F, \u7528\u4E8E\u51CF\u5C11\u8D44\u6E90\u8D1F\u8377\u7684\u53D8\u5316\u3002\u5305\u62EC\uFF1A</p><p>\uFF081\uFF09\u8D44\u6E90\u5E73\u8861\uFF1A\u5982\u679C\u5171\u4EAB\u8D44\u6E90\u6216\u5173\u952E\u8D44\u6E90\u53EA\u5728\u7279\u5B9A\u65F6\u95F4\u53EF\u7528, \u6570\u91CF\u6709\u9650, \u6216\u88AB\u8FC7\u5EA6\u5206\u914D, \u5C31\u9700\u8981\u8FDB\u884C\u8D44\u6E90\u5E73\u8861\u3002\u4E5F\u53EF\u4EE5\u4E3A\u4FDD\u6301\u8D44\u6E90\u4F7F\u7528\u91CF\u5904\u4E8E\u5747\u8861\u6C34\u5E73\u800C\u8FDB\u884C\u8D44\u6E90\u5E73\u8861\u3002\u8D44\u6E90\u5E73\u8861\u5F80\u5F80\u5BFC\u81F4\u5173\u952E\u8DEF\u5F84\u6539\u53D8\u3002\u3010\u8D44\u6E90\u88AB\u8FC7\u6E21\u5206\u914D, \u51FA\u73B0\u4E86\u8D44\u6E90\u77ED\u7F3A, \u9700\u8981\u8FDB\u884C\u8D44\u6E90\u5E73\u8861\u3011 \uFF082\uFF09\u8D44\u6E90\u5E73\u6ED1\uFF1A\u8D44\u6E90\u5E73\u6ED1\u4E0D\u4F1A\u6539\u53D8\u9879\u76EE\u5173\u952E\u8DEF\u5F84, \u6D3B\u52A8\u53EA\u5728\u5176\u81EA\u7531\u548C\u603B\u6D6E\u52A8\u65F6\u95F4\u5185\u5EF6\u8FDF, \u4F46\u8D44\u6E90\u5E73\u6ED1\u6280\u672F\u53EF\u80FD\u65E0\u6CD5\u5B9E\u73B0\u6240\u6709\u8D44\u6E90\u7684\u4F18\u5316\u3002\u3010\u5F53\u5404\u4E2A\u65F6\u95F4\u6BB5\u5185\u6240\u9700\u7684\u8D44\u6E90\u6570\u91CF\u8D77\u4F0F\u592A\u5927\u65F6, \u9700\u8981\u505A\u8D44\u6E90\u5E73\u6ED1\u3011</p><p>\u8FDB\u5EA6\u538B\u7F29\uFF08\u89E3\u51B3\u5DE5\u671F\u95EE\u9898\uFF09\uFF1A\u8FDB\u5EA6\u538B\u7F29\u6280\u672F\u662F\u6307\u5728\u4E0D\u7F29\u51CF\u9879\u76EE\u8303\u56F4\u7684\u524D\u63D0\u4E0B, \u7F29\u77ED\u6216\u52A0\u5FEB\u8FDB\u5EA6\u5DE5\u671F, \u4F7F\u8FDB\u5EA6\u7B26\u5408\u8981\u6C42\u3002</p><p>\uFF081\uFF09\u8D76\u5DE5\uFF1A\u901A\u8FC7\u589E\u52A0\u8D44\u6E90, \u4EE5\u6700\u5C0F\u7684\u6210\u672C\u4EE3\u4EF7\u6765\u538B\u7F29\u8FDB\u5EA6\u5DE5\u671F\u7684\u4E00\u79CD\u6280\u672F\u3002\u4F8B\u5B50\u5305\u62EC\uFF1A\u6279\u51C6\u52A0\u73ED\u3001\u589E\u52A0\u989D\u5916\u8D44\u6E90\u6216\u652F\u4ED8\u52A0\u6025\u8D39\u7528\u3002\u53EA\u9002\u7528\u4E8E\u90A3\u4E9B\u901A\u8FC7\u589E\u52A0\u8D44\u6E90\u5C31\u80FD\u7F29\u77ED\u6301\u7EED\u65F6\u95F4\u7684, \u4E14\u4F4D\u4E8E\u5173\u952E\u8DEF\u5F84\u4E0A\u7684\u6D3B\u52A8\u3002\uFF08\u589E\u52A0\u6210\u672C\uFF09 \uFF082\uFF09\u5FEB\u901F\u8DDF\u8FDB\uFF1A\u5C06\u6B63\u5E38\u60C5\u51B5\u4E0B\u6309\u987A\u5E8F\u8FDB\u884C\u7684\u6D3B\u52A8\u6216\u9636\u6BB5\u6539\u4E3A\u81F3\u5C11\u662F\u90E8\u5206\u5E76\u884C\u5F00\u5C55\u3002\u53EA\u9002\u7528\u4E8E\u76F8\u4E92\u4E3A\u9009\u62E9\u6027\u4F9D\u8D56\u5173\u7CFB\u7684\u6D3B\u52A8\u3002\u5728\u67D0\u4E00\u9879\u6D3B\u52A8\u5B8C\u6210\u4E4B\u524D\u5F00\u59CB\u53E6\u4E00\u9879\u6D3B\u52A8\u3002\uFF08\u589E\u52A0\u98CE\u9669\uFF09</p><p>\u8FDB\u5EA6\u843D\u540E\u4F18\u5148\u7EA7\u9009\u62E9\uFF1A\u8FDB\u5EA6\u538B\u7F29 &gt; \u8D76\u5DE5 &gt; \u5FEB\u901F\u8DDF\u8FDB</p><p><img src="'+l+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u5236\u5B9A\u8FDB\u5EA6\u8BA1\u5212"></p><h2 id="\u63A7\u5236\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u63A7\u5236\u8FC7\u7A0B\u7EC4</h2><h3 id="\u63A7\u5236\u8FDB\u5EA6" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u8FDB\u5EA6" aria-hidden="true">#</a> \u63A7\u5236\u8FDB\u5EA6</h3><p>\u63A7\u5236\u8FDB\u5EA6\u662F\u76D1\u7763\u9879\u76EE\u72B6\u6001, \u4EE5\u66F4\u65B0\u9879\u76EE\u8FDB\u5EA6\u548C\u7BA1\u7406\u8FDB\u5EA6\u57FA\u51C6\u53D8\u66F4\u7684\u8FC7\u7A0B\u3002\u672C\u8FC7\u7A0B\u7684\u4E3B\u8981\u4F5C\u7528\u662F\u5728\u6574\u4E2A\u9879\u76EE\u671F\u95F4\u4FDD\u6301\u5BF9\u8FDB\u5EA6\u57FA\u51C6\u7684\u7EF4\u62A4, \u4E14\u9700\u8981\u5728\u6574\u4E2A\u9879\u76EE\u671F\u95F4\u5F00\u5C55\u3002</p><h4 id="itto-5" tabindex="-1"><a class="header-anchor" href="#itto-5" aria-hidden="true">#</a> ITTO</h4><p><img src="'+o+'" alt="\u9879\u76EE\u8FDB\u5EA6\u7BA1\u7406-\u63A7\u5236\u8FDB\u5EA6"></p><h2 id="\u672C\u7AE0\u91CD\u70B9" tabindex="-1"><a class="header-anchor" href="#\u672C\u7AE0\u91CD\u70B9" aria-hidden="true">#</a> \u672C\u7AE0\u91CD\u70B9</h2><ul><li>\u5982\u679C\u5728\u6267\u884C\u8FC7\u7A0B\u4E2D\u53D1\u73B0\u67D0\u4E2A\u6D3B\u52A8\u7684\u603B\u6D6E\u52A8\u65F6\u95F4\u4E3A\u8D1F, \u6781\u6709\u53EF\u80FD\u8BE5\u6D3B\u52A8\u662F\u5173\u952E\u6D3B\u52A8, \u800C\u4E14\u5DF2\u7ECF\u5EF6\u671F</li><li>\u5982\u679C\u9898\u76EE\u4E2D\u4F53\u73B0\u4E86\u65F6\u95F4\u8981\u7F29\u77ED, \u9700\u8981\u538B\u7F29\u5DE5\u671F, \u9009\u62E9\u8FDB\u5EA6\u538B\u7F29\uFF08\u8D76\u5DE5\u6216\u8005\u5FEB\u901F\u8DDF\u8FDB\uFF09</li><li>\u5982\u679C\u9898\u76EE\u4E2D\u4F53\u73B0\u4E86\u8D44\u6E90\u8D1F\u8377\u5927, \u9700\u8981\u5E73\u644A\u8D1F\u8377, \u9009\u62E9\u8D44\u6E90\u4F18\u5316\uFF08\u8D44\u6E90\u5E73\u8861\u6216\u8D44\u6E90\u5E73\u6ED1\uFF09</li><li>\u5173\u952E\u8DEF\u5F84\u4E0A\u538B\u5DE5\u671F, \u975E\u5173\u952E\u8DEF\u5F84\u4E0A\u62BD\u8D44\u6E90</li><li>\u8FDB\u5EA6\u843D\u540E, \u4EA7\u751F\u8FDB\u5EA6\u504F\u5DEE, \u4F18\u5148\u8003\u8651\u7528\u7EA0\u6B63\u63AA\u65BD\u538B\u7F29\u8FDB\u5EA6\uFF08\u8D76\u5DE5\u6216\u5FEB\u901F\u8DDF\u8FDB\uFF09\uFF1B</li><li>\u5982\u679C\u5B9E\u5728\u65E0\u6CD5\u7B26\u5408\u8FDB\u5EA6, \u4E0D\u5F97\u5DF2\u7684\u60C5\u51B5\u4E0B, \u518D\u8003\u8651\u901A\u8FC7\u53D8\u66F4\u6D41\u7A0B\u7F29\u51CF\u8303\u56F4\u6216\u5EF6\u957F\u8FDB\u5EA6\u3002</li></ul>',50),g=[m];function u(_,f){return e(),r("div",null,g)}var v=a(c,[["render",u],["__file","project-progress-management.html.vue"]]);export{v as default};
